INSERT INTO Prompt VALUES("b8eca11e-6f42-11e2-9924-109adda800ea", "Doctor 1", "A little longer and we would have lost her.", null, null, null, 1);
INSERT INTO Prompt VALUES("b8eca254-6f42-11e2-a08d-109adda800ea", "Doctor 2", "I’m still not convinced we haven’t.", null, null, null, 1);
INSERT INTO Prompt VALUES("b8eca3b3-6f42-11e2-b3b5-109adda800ea", "Doctor 1", "The arm should be able to contain the energy for the time being.", null, null, null, 1);
INSERT INTO Prompt VALUES("b8eca50f-6f42-11e2-9658-109adda800ea", "Doctor 2", "Let’s hope you’re right. How should we proceed?", null, null, null, 1);
INSERT INTO Prompt VALUES("b8eca66e-6f42-11e2-a7ff-109adda800ea", "Doctor 1", "I’m still very curious as to the circumstances that brought her here in the first place. Let’s see if we can get a memory reading.", null, null, null, 1);
INSERT INTO Prompt VALUES("b8eca7eb-6f42-11e2-9a1a-109adda800ea", "Doctor 2", "Sure.", null, null, null, 0);
INSERT INTO Prompt VALUES("b8eca966-6f42-11e2-bb70-109adda800ea", "Town Guard", "How many times have I had to tell you? This kind of behavior will NOT be tolerated in my town.", null, null, null, 1);
INSERT INTO Prompt VALUES("b8ecab28-6f42-11e2-8afd-109adda800ea", "Town Guard", "What do you have to say for yourself?", null, null, null, 1);
INSERT INTO Prompt VALUES("b8ecacc2-6f42-11e2-a332-109adda800ea", "Town Guard", "That's it. I've had enough of this. Get out of here.", null, null, null, 0);
INSERT INTO Prompt VALUES("b8ecae66-6f42-11e2-a8dd-109adda800ea", "Friend", "I heard what happened. Are you okay? What are you going to do now?", null, null, null, 1);
INSERT INTO Prompt VALUES("b8ecb014-6f42-11e2-b74b-109adda800ea", "Friend", "Figured as much. Anyway, you should probably lay low for a while. Maybe kick around for a little while on the outskirts of town. Be careful, though. I've heard about a lot of weird stuff going on lately.", null, null, null, 0);
INSERT INTO Prompt VALUES("b8ecb1d7-6f42-11e2-8557-109adda800ea", "Doctor 1", "Hmm... Interesting, but there has to be more to this story. See if we can progress the timeline a little further.", null, null, null, 0);
INSERT INTO Prompt VALUES("b8ecb38c-6f42-11e2-b38b-109adda800ea", "Doctor 2", "Was that what I thought it was?", null, null, null, 1);
INSERT INTO Prompt VALUES("b8ecb559-6f42-11e2-ba06-109adda800ea", "Doctor 1", "It would appear so.", null, null, null, 1);
INSERT INTO Prompt VALUES("b8ecb726-6f42-11e2-beae-109adda800ea", "Doctor 2", "Does that make her the...?", null, null, null, 1);
INSERT INTO Prompt VALUES("b8ecb907-6f42-11e2-bb80-109adda800ea", "Doctor 1", "Indeed. We have to send her back. The energy should be subdued as long as the arm is intact.", null, null, null, 1);
INSERT INTO Prompt VALUES("b8ecbaf8-6f42-11e2-a158-109adda800ea", "Doctor 2", "Where do you propose we send her?", null, null, null, 1);
INSERT INTO Prompt VALUES("b8ecbd00-6f42-11e2-9b17-109adda800ea", "Doctor 1", "Anywhere that isn’t here. Use your imagination.", null, null, null, 1);
INSERT INTO Prompt VALUES("b8ecbf1e-6f42-11e2-8867-109adda800ea", "Doctor 2", "Alright. I’ll get dispatch to bring her back to the machine.", null, null, null, 1);
INSERT INTO Prompt VALUES("b8ecc14f-6f42-11e2-9eca-109adda800ea", "Doctor 1", "Hey, before you go, find a tech to send over as well. We need to ensure she is unable to return to our time. We wouldn’t want another mishap like that one, would we?", null, null, null, 1);
INSERT INTO Prompt VALUES("b8ecc387-6f42-11e2-a228-109adda800ea", "Doctor 2", "Will do.", null, null, null, 0);
